						
CREATE EXTENSION if not exists hstore;
CREATE EXTENSION if not exists postgis;

CREATE TABLE if not exists osm_element_history (
	id int8 NULL,
	"type" varchar NULL,
	tags hstore NULL,
	lat numeric(9, 7) NULL,
	lon numeric(10, 7) NULL,
	nds _int8 NULL,
	members _text NULL,
	changeset int8 NULL,
	"timestamp" timestamp NULL,
	uid int8 NULL,
	"version" int8 NULL,
	"action" varchar NULL,
	country varchar NULL,
	geom geometry NULL,
	CONSTRAINT osm_element_history_un UNIQUE (id, version, type)
)  ;

	CREATE TABLE if not exists osm_changeset (
	id int8 NOT NULL,
	user_id int8 NULL,
	created_at timestamp NULL,
	min_lat numeric(10, 7) NULL,
	max_lat numeric(10, 7) NULL,
	min_lon numeric(10, 7) NULL,
	max_lon numeric(10, 7) NULL,
	closed_at timestamp NULL,
	"open" bool NULL,
	num_changes int4 NULL,
	user_name varchar(255) NULL,
	tags hstore NULL,
	geom geometry(polygon, 4326) NULL,
	CONSTRAINT osm_changeset_pkey PRIMARY KEY (id)
) ;

	
	 
	
	 
	
